import Modal from '../UI/Modal/Modal';
import classes from './Cart.module.css';

const Cart = (props) => {
    const cartItems = <ul className={classes['cart-items']}>{[{id: 'c1', name: 'Sushi', price: '$10.11', amount: 2}].map(item => (
        <li>{item.name}</li>
    ))}</ul>

    return (
        <Modal>
            <div>
                {cartItems}
                <div className={classes.total}>
                    <span>Total Amount</span>
                    <span>$35.60</span>
                </div>
                <div className={classes.action}>
                <button type='button' className={classes['button--alt']}>Close</button>
                <button type='button' className={classes.button}>Order</button>
                </div>
            </div>
        </Modal>
    );
};

export default Cart;
